(6, 1, 'Una yema del dedo biónico permite a un amputado sentir texturas de nuevo', '<span style="font-weight: 400;">Investigadores de la E<a href="https://www.epfl.ch/" target="_blank">scuela Politécnica Federal de Lausana (EPFL)</a> y la <a href="http://www.santannapisa.it/it" target="_blank">Scuola Superiore Sant''Anna (SSSA),</a> dicen que han creado un <a href="http://elifesciences.org/content/5/e09148v2" target="_blank">dedo artificial </a>que permite a los amputados diferenciar entre superficies lisas y rugosas, en tiempo real.</span>\r\n\r\n<span style="font-weight: 400;">"La sensación táctil es bastante cercana de lo que se puede sentir con el dedo normal", dice Dennis </span><span style="font-weight: 400;">Aavo Sorenson </span><span style="font-weight: 400;">un usuario amputado de la tecnología en un video de EPFL. </span>\r\n\r\n<span style="font-weight: 400;">Para el video, Sorenson tiene la tarea de detectar si puede sentir los surcos en una pequeña pieza rectangular con el dedo artificial. "Se puede sentir la aspereza de las placas, y los diferentes huecos", señala.</span>\r\n\r\n<span style="font-weight: 400;">Los investigadores describen que quirúrgicamente conectan la punta del dedo artificial, repleto de sensores, a electrodos implantados en el sistema nervioso periférico en la izquierda muñón del brazo de Sorensen. Ellos creen que su invento podría acelerar el desarrollo de prótesis dotadas de características avanzadas con retroalimentación sensorial en el futuro. El objetivo principal es que los usuarios sean capaces de recuperar una comprensión del peso, textura de superficies, y las temperaturas de los objetos que los rodean.</span>\r\n\r\n<span style="font-weight: 400;"><img class="alignnone" src="https://media.giphy.com/media/m9lcTfGUV0LvO/giphy.gif" alt="" width="480" height="270" /></span>\r\n\r\n<span style="font-weight: 400;">Para probar el dedo biónico, los investigadores eligieron cuatro voluntarios sanos no amputados junto Sorensen para actuar como sujetos de control y conectaron la yema del dedo artificial a ellos a través de un electrodo insertado en un nervio en su brazo. A continuación, mueven la yema del dedo sobre un trozo de plástico grabado con superficies lisas y rugosas, por lo que los sensores producen "patrones de impulsos eléctricos que estimulan el nervio".</span>\r\n\r\n<img class="alignnone" src="https://media.giphy.com/media/2uPRaeWKAdEjK/giphy.gif" alt="" width="480" height="270" />\r\n\r\nEllos encontraron que los voluntarios de control eran capaces de distinguir entre diferentes texturas 77% del tiempo; Sorensen respondió correctamente 96% del tiempo. Al comparar la actividad de las ondas cerebrales captadas a través de un dispositivo de EEG entre las reacciones de los no amputados y amputados, encontró que las mismas regiones del cerebro se activaron. Estos resultados confirman que las diferentes superficies de textura pueden ser distinguidas por amputados, allanando el camino para un estudio que involucró a más participantes y prototipos avanzados del dedo biónico.\r\n<iframe src="https://www.youtube.com/embed/Ebd_Yc0oDZI" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe>\r\n\r\n<span style="font-weight: 400;">A pesar de que esto es solo un comienzo hay grandes esperanzas de que los sistemas sensibles al tacto tendrán aplicaciones no sólo para prótesis, sino también para la robótica utilizados en la cirugía, el rescate y la fabricación. Por ejemplo, robots humanoides de rescate con sensores táctiles en sus pies podrían ser capaces de detectar en qué tipo de terreno se encuentran, y ajustar su equilibrio en consecuencia.</span>', 'https://cerebrodigital.org/wp-content/uploads/2016/04/amputee.jpg', 0, 'una-yema-del-dedo-bionico-permite-amputado-sentir-texturas-nuevo', 'publicada', '2016-04-27 05:23:11', '2016-05-01 12:05:38', 0, 'image', '', ''),
(8, 1, 'Llevan a las moléculas de agua a un nuevo estado de la materia', '<span style="font-weight: 400;">Científicos del laboratorio </span><a href="https://www.ornl.gov/news/ornl-researchers-discover-new-state-water-molecule" target="_blank"><span style="font-weight: 400;">Nacional Oak Ridge</span></a><span style="font-weight: 400;">, llevaron a las </span><a href="http://journals.aps.org/prl/abstract/10.1103/PhysRevLett.116.167802" target="_blank"><span style="font-weight: 400;">moléculas de agua a un estado totalmente diferente</span></a><span style="font-weight: 400;"> que no se adhiere a las leyes de los sólidos, líquidos o gases.</span>\r\n\r\n<span style="font-weight: 400;">Atrapando a las moléculas de agua en pequeñas grietas, similares a las que existen en la naturaleza, los investigadores han logrado que los átomos de oxígeno e hidrógeno se comporten de una manera muy peculiar.</span>\r\n\r\n<span style="font-weight: 400;">El descubrimiento está ligado a los previos conocimientos en física cuántica. Los científicos forzaron a las moléculas de agua a pasar por canales hechos de</span><a href="https://es.wikipedia.org/wiki/Berilo" target="_blank"><span style="font-weight: 400;"> mineral berilo</span></a><span style="font-weight: 400;">, que miden tan sólo 5 angstroms de ancho (aproximadamente 1 de diez millonésima parte de un metro). Como pueden existir en la naturaleza, dentro de los suelos, interfaces minerales, y las paredes celulares.</span>\r\n\r\n<span style="font-weight: 400;">Ahí dentro (los átomos individuales miden aproximadamente 1 nm de diámetro), los dos átomos de hidrógeno y uno de oxígeno que forman una molécula de agua comenzaron a mostrar un comportamiento muy extraño. En lugar de estar fijos, los átomos de hidrógeno comenzaron a aparecer en seis orientaciones simétricas diferentes al mismo tiempo, con el átomo de oxígeno en el medio, y las seis posiciones diferentes coinciden con las seis paredes de un canal hexagonal.</span>\r\n\r\nConforme fueron haciendo un túnel, átomos de hidrógeno se intercambiaron entre todas las posiciones posibles, y como resultado la temperatura se incrementó.\r\n\r\n<span style="font-weight: 400;">El centro de la masa de la molécula se desplazó hacia el átomo central de oxígeno en lugar de los de hidrógeno periféricos (como sería el caso en una molécula típica). </span>\r\n\r\n<span style="font-weight: 400;">La disposición simétrica significa que la molécula perdió su </span><a href="https://es.wikipedia.org/wiki/Dipolo_el%C3%A9ctrico" target="_blank"><span style="font-weight: 400;">momento dipolar eléctrico</span></a><span style="font-weight: 400;">, lo que significa que las cargas negativas y positivas de los átomos ya no están desequilibradas, y en teoría, ya no se deberían interesar en unirse con otros átomos o moléculas.</span>\r\n<span style="font-weight: 400;">El siguiente paso es averiguar por qué se produce este fenómeno, y con las investigaciones dar a los científicos una mejor comprensión del comportamiento del agua y la termodinámica cuando está en ambientes muy reducidos.</span>', 'https://cerebrodigital.org/wp-content/uploads/2016/04/watermolecule.jpg', 49, 'llevan-las-moleculas-agua-nuevo-estado-la-materia', 'publicada', '2016-04-27 05:24:49', '2016-05-01 12:05:26', 0, 'image', '', ''),
(9, 1, 'Estos son los planes de Mark Zuckerberg con las acciones de facebook que donará', 'En la estructura de facebook a pesar de que donan la mayoría de sus acciones, Zuckerberg mantiene el control total.\r\n\r\n<span style="font-weight: 400;">Zuckerberg anunció previamente que planea dar el 99% de sus acciones de Facebook, y esbozó los tres desafíos globales con los que siente "una responsabilidad para ayudar a resolver."</span>\r\n<ul>\r\n   <li style="font-weight: 400;"><em><span style="font-weight: 400;">Curar todas las enfermedades a finales de este siglo</span></em></li>\r\n   <li style="font-weight: 400;"><em><span style="font-weight: 400;">Actualizar el sistema educativo para que sea personalizado para cada estudiante</span></em></li>\r\n  <li style="font-weight: 400;"><span style="font-weight: 400;"><em>Protección nuestro medio ambiente del cambio climático.</em></span></li>\r\n</ul>\r\n<span style="font-weight: 400;">"En este momento, hay sorprendentes científicos, educadores y médicos en todo el mundo que realizan un trabajo increíble", añade. "Queremos ayudar a hacer una diferencia más grande hoy en día, no en 30 o 40 años."</span>\r\n\r\n<span style="font-weight: 400;">Esta es la</span><a href="http://newsroom.fb.com/news/2016/04/marknote/" target="_blank"><span style="font-weight: 400;"> carta completa de Zuckerberg:</span></a>\r\n\r\n<span style="font-weight: 400;">Todo lo que hacemos en Facebook se centra en nuestra misión de hacer el mundo más abierto y conectado.</span>\r\n\r\n<span style="font-weight: 400;">Para mantener nuestro enfoque en esta misión, siempre hemos sido una empresa dirigida por el fundador. Esta estructura ha ayudado a resistir las presiones a corto plazo que a menudo perjudican a las empresas. Nos ha ayudado a crecer nuestra comunidad, construir nuestro negocio y crear valor para los accionistas. Nos ha dado la libertad de dar prioridad a la experiencia con el producto e invertir en nuevas aplicaciones como Instagram, decisiones que no siempre se pagan de inmediato, pero que creemos que ayudará a servir a nuestra comunidad y nuestros accionistas.</span>\r\n\r\n<span style="font-weight: 400;">Cuando miro hacia fuera en el futuro, veo más movimientos atrevidos por delante y detrás de nosotros. Estamos centrados no en el Facebook es hoy en día, en lo que puede ser, y lo que tiene que ser para nuestra comunidad. Eso significa invertir en áreas como la extensión de la conectividad, la construcción de la inteligencia artificial y el desarrollo de la realidad virtual y aumentada. Estoy comprometido con nuestra misión y conducir Facebook en el largo plazo.</span>\r\n\r\n<span style="font-weight: 400;">Mientras que ayudar a conectar el mundo siempre va a ser la cosa más importante, hay retos más globales que siento la responsabilidad de ayudar a resolver, cómo ayudar a curar todas las enfermedades a finales de este siglo, la mejora de nuestro sistema educativo para que sea personalizado a cada estudiante, y la protección de nuestro medio ambiente del cambio climático. Es por eso que Priscila y yo creamos la Iniciativa Zuckerberg Chan y comprometidos para dar el 99% de las acciones de Facebook durante nuestras vidas para avanzar en el potencial humano y la promoción de la igualdad.</span>\r\n\r\n<span style="font-weight: 400;">Hoy en día, la junta directiva de Facebook ha anunciado una propuesta para crear una nueva clase de acciones que nos permitirá alcanzar ambos objetivos. Voy a ser capaz de mantener el control fundador de Facebook para que podamos construir para el largo plazo, y Priscila y yo seremos capaces de dar nuestro dinero para financiar el trabajo importante antes. En este momento, hay científicos sorprendentes, educadores y médicos de todo el mundo realizan un trabajo increíble. Queremos ayudar a hacer una diferencia más grande hoy en día, no 30 o 40 años.</span>\r\n<span style="font-weight: 400;">Si esta propuesta entre en vigor, vamos a llegar a seguir mejorando tu experiencia en Facebook de la forma en que hacemos hoy en día. Y en el largo plazo, yo creo que podrás tener mejores servicios y ser parte de una comunidad más fuerte como resultado. Creo en nuestra comunidad y el bien que podemos hacer en el mundo, y estoy deseando continuar este viaje.</span>', 'https://cerebrodigital.org/wp-content/uploads/2016/04/facebookkk.jpg', 43, 'los-planes-mark-zuckerberg-las-acciones-facebook-donara', 'publicada', '2016-04-27 05:25:44', '2016-05-01 12:05:16', 1, 'image', 'zuckerberg,facebook,planes', ''),
(10, 1, '¿Cómo manejan su periodo en el espacio las astronautas?', '<span style="font-weight: 400;">Valentina Tereshkova fue la primera mujer en viajar al espacio en </span><span style="font-weight: 400;">1963, ya que la menstruación en el espacio era un tema misterioso, fue enviada entre su periodo.</span>\r\n\r\n<span style="font-weight: 400;">Años más tarde </span><span style="font-weight: 400;">antes de poder lanzar al espacio a Sally Ride (la primera mujer estadounidense en ir al espacio en 1983), los ingenieros seguían tratando de definir cómo podían manejar la menstruación en el espacio, incluso le llegaron a preguntar a Sally si sería suficiente mandar 100 tampones para una misión de 1 semana. El staff médico de la NASA tampoco sabían cómo afectaría la microgravedad a la menstruación, ¿acaso la sangre fluye de la forma adecuada?, o ¿regresa al útero y ocasiona problemas de salud?.</span>\r\n\r\n<span style="font-weight: 400;">Resulta que ninguno de esos problemas se presenta en el espacio, y las mujeres pueden menstruar con los artículos sanitarios necesarios, como tampones y toallas que funcionan atrayendo líquidos por capilaridad cuando la gravedad no está allí para ayudar. </span>\r\n\r\n<span style="font-weight: 400;">Pero hay un problema todos los datos de la menstruación en el espacio han sido en cortos periodos de tiempo. Ahora los investigadores se preguntan qué pasará en misiones más extendidas como ir a Marte. </span>\r\n\r\n<span style="font-weight: 400;">Los sistemas de desecho en ISS no están diseñados para manejar la menstruación, ya que el agua está conectada a un sistema que recicla el orina en agua potable. </span>\r\n\r\n<span style="font-weight: 400;">Como resultado cada vez son más las mujeres astronautas que han decidido usar métodos </span><a href="http://www.nature.com/articles/npjmgrav20168"><span style="font-weight: 400;">para saltarse sus periodos</span></a><span style="font-weight: 400;">, como anticonceptivos orales, dispositivo intrauterino, e implantes subdérmicos.</span>\r\n<span style="font-weight: 400;">Una exploración de 3 años requería alrededor de 1,100 pastillas y sus empaques agregarían más basura. Es sabido que en los astronautas disminuye la densidad ósea y algunos estudios de las píldoras de progesterona sugieren que aumenta la pérdida ósea. Por lo que no son tan buena opción.</span>', 'https://cerebrodigital.org/wp-content/uploads/2016/04/astronaut.jpg', 2, 'manejan-periodo-espacio-las-astronautas', 'publicada', '2016-04-27 05:26:45', '2016-05-01 12:04:16', 1, 'imageURL', 'periodo,astronautas,espacio', ''),
(11, 1, 'Finalmente podrían probar que existe la radiación de Hawking', '<span style="font-weight: 400;">Dos grupos independientes de investigadores informan que han encontrado evidencia para respaldar las afirmaciones de Hawking. Hace unos 42 años, el renombrado físico teórico Stephen Hawking propuso que </span><a href="https://cerebrodigital.org/grandes-ideas-stephen-hawking-explicadas-sencillas-animaciones/"><span style="font-weight: 400;">no todo lo que entra en contacto con un agujero negro sucumbe a su nada.</span></a><span style="font-weight: 400;"> Las diminutas partículas de luz (</span><a href="https://es.wikipedia.org/wiki/Fot%C3%B3n"><span style="font-weight: 400;">fotones</span></a><span style="font-weight: 400;">) a veces son expulsadas de vuelta, robando al agujero negro una cantidad infinitesimal de la energía, y esta pérdida gradual de masa con el tiempo significa cada agujero negro se evapora de la existencia.</span>\r\n\r\n<span style="font-weight: 400;">La existencia de la radiación de Hawking ha respondido a muchas preguntas acerca de cómo funcionan realmente los agujeros negros, pero en el proceso, ha planteado un montón de problemas que los físicos todavía están tratando de conciliar.</span>\r\n\r\n<span style="font-weight: 400;">¿Recuerdas que los fotones que escapan roban una cantidad infinitesimal de la energía de un agujero negro cada vez que se escapan? Bueno, esta radiación es tan delicada, y es prácticamente imposible detectarla desde hace miles de años luz de distancia.</span>\r\n\r\n<span style="font-weight: 400;">Pero el físico </span><a href="http://phsites.technion.ac.il/atomlab/"><span style="font-weight: 400;">Jeff Steinhauer</span></a><span style="font-weight: 400;"> de la </span><a href="http://www.technion.ac.il/en/"><span style="font-weight: 400;">Universidad Technion en Haifa</span></a><span style="font-weight: 400;">, Israel, piensa que si no podemos detectar la radiación Hawking en agujeros negros reales a miles de años luz de distancia con nuestros mejores instrumentos, que </span><a href="https://arxiv.org/ftp/arxiv/papers/1510/1510.00621.pdf"><span style="font-weight: 400;">podemos crear agujeros negros con nuestros mejores instrumentos</span></a><span style="font-weight: 400;">.</span>\r\n\r\nSteinhauer ha logrado crear un "agujero negro" en el laboratorio hecho de sonido, y fue testigo de que las partículas roban energía a partir de sus márgenes. Dice que enfrió el helio justo por encima del cero absoluto,y  a continuación, lo removieron tan rápido, que formó una "barrera" a través del cual el sonido no puede pasar.\r\n\r\n<span style="font-weight: 400;">"Steinhauer dijo que había encontrado indicios de que los</span><a href="https://es.wikipedia.org/wiki/Fon%C3%B3n"><span style="font-weight: 400;"> fonones,</span></a><span style="font-weight: 400;"> los pequeños paquetes de energía que componen las ondas sonoras, se escapaban de su agujero negro sónico al igual que las ecuaciones de Hawking predice.</span>\r\n\r\nLos resultados del experimento aún están siendo revisados por físicos de todo el mundo.\r\n\r\n<span style="font-weight: 400;">Mientras tanto, los físicos Chris Adami y Kamil Bradler de la</span><a href="http://www.uottawa.ca/"><span style="font-weight: 400;"> Universidad de Ottawa</span></a><span style="font-weight: 400;"> describen una nueva técnica que </span><a href="http://journals.aps.org/prl/abstract/10.1103/PhysRevLett.116.101301"><span style="font-weight: 400;">les permite seguir la vida de un agujero negro en el tiempo</span></a><span style="font-weight: 400;">.</span>\r\n\r\n<span style="font-weight: 400;">Eso es algo muy emocionante, porque significa que cualquier información o materia que pasa por encima del horizonte de sucesos no "desaparece", y está goteando lentamente durante las últimas etapas de la evaporación de un agujero negro.</span>\r\n\r\n<span style="font-weight: 400;">"Para realizar este cálculo, tuvimos que adivinar cómo interactúa un agujero negro con el campo de radiación de Hawking que lo rodea", dijo Chris Adami. "Ya que actualmente no hay ninguna teoría de gravedad cuántica que pueda sugerir tal interacción. Sin embargo, parece que hicimos una conjetura adecuada porque nuestro modelo es equivalente a la teoría de Hawking."</span>\r\n\r\n<span style="font-weight: 400;">Ambos resultados ahora tendrá que ser confirmados, pero sugieren que estamos cada vez más cerca de confirmar o refutar la existencia de la radiación de Hawking, y eso es una buena noticia.</span>\r\n', 'https://cerebrodigital.org/wp-content/uploads/2016/04/Hawking_andEventHorizon2-150.jpg', 3, 'finalmente-podradiacion-hawking', 'publicada', '2016-04-27 05:28:27', '2016-05-01 10:49:21', 1, 'imageURL', 'ciencia, hawking, cosmos, universo', ''),
(12, 1, 'Las tres tecnologías que definirán el futuro', '<p></p><p>Hace más de un año que cruzamos la línea de mitad de década, adentrándonos a lo que serán los años 20 del nuevo siglo; un siglo que se ha caracterizado por cambios gigantescos en nuestro estilo de vida, como el acceso a Internet las 24 horas del día, la explosión de plataformas Web de búsqueda, información y contenidos multimedia, la invención de los teléfonos inteligentes, el automóvil eléctrico, y nuevas tecnologías en todos los ámbitos de la vida humana.\r\n\r\nRay Kurzweil, en su libro <em>La era de las máquinas espirituales</em> (1999), introdujo la <em>ley de rendimientos acelerados</em>, la cual establece que la tasa de cambio y crecimiento de las nuevas tecnologías tiende a incrementarse de manera exponencial. Como es natural para nosotros visualizar el futuro linealmente, nos es difícil imaginar la velocidad real a la que evoluciona la tecnología.\r\n\r\nComo se explica en <a href="http://singularityhub.com/2016/04/19/ray-kurzweil-predicts-three-technologies-will-define-our-future/?utm_content=buffer74d7b&utm_medium=social&utm_source=facebook.com&utm_campaign=buffer">este artículo</a> de la <em>Singularity University</em>, Kurzweil afirma que son <strong>la genética, la nanotecnología y la robótica</strong> las tecnologías que cambiarán nuestro mundo a lo largo de este siglo.  Si yahoo ya quedo</p><p><span style="color: inherit; font-size: 24px; line-height: 1.1;">Genética - reprogramando nuestra biología</span></p>\r\n<a href="http://cerebrodigital.org/wp-content/uploads/2016/04/giphy-2-2.gif"><img class="size-full wp-image-7128 aligncenter" src="http://cerebrodigital.org/wp-content/uploads/2016/04/giphy-2-2.gif" alt="giphy (2)" width="480" height="270"></a><a href="http://cerebrodigital.org/wp-content/uploads/2016/04/giphy-1-2.gif"><img class="size-full wp-image-7129 aligncenter" src="http://cerebrodigital.org/wp-content/uploads/2016/04/giphy-1-2.gif" alt="giphy (1)" width="480" height="270"></a>\r\n<p></p><p>\r\nEn 2003 se completó el Proyecto del Genoma Humano. Desde entonces, hemos sido capaces de alterar el código genético de seres vivos que van desde bacterias hasta perros. Avances en este campo incluyen:\r\n</p><ul>\r\n   <li><strong><a href="http://stemcells.nih.gov/info/basics/pages/basics10.aspx">Células madre pluripotentes inducidas</a></strong> - programadas para comportarse como células madre.</li>\r\n   <li><strong><a href="http://singularityhub.com/2016/01/21/crisprcas9-genome-editing-is-a-huge-deal-but-its-just-the-tip-of-the-iceberg/">Edición del genoma humano</a></strong> - manipulación de cadenas de ADN para desarrollos en medicina y agricultura.</li>\r\n   <li><strong><a href="http://singularityhub.com/2015/12/31/printable-organs-are-closer-than-ever-thanks-to-three-bioprinting-breakthroughs/">Bioimpresión 3D</a></strong> - desde vasos sanguíneos hasta órganos enteros, sin necesidad de donador alguno.</li>\r\n  <li><strong><a href="http://singularityhub.com/2014/02/02/illumina-claims-new-sequencer-transcribes-18000-genomes-per-year-at-1000-each/">Genoma $1,000</a></strong> - secuenciación del genoma individual para predecir enfermedades y transtornos, a un costo sin precedentes.</li>\r\n   <li><strong><a href="http://singularityhub.com/2015/01/19/lab-grown-muscles-to-serve-as-clinical-trials-in-a-dish/">Tejido artificial</a></strong> - fibras musculares humanas en un plato de laboratorio, para estudiar enfermedades, medicamentos y terapias.</li>\r\n  <li><strong><a href="http://singularityhub.com/2016/04/17/this-droplet-of-dna-could-store-600-smartphones-worth-of-retrievable-data/">Almacenamiento en ADN</a></strong> - empleo del código de la vida para almacenar enormes cantidades de datos digitales.</li>\r\n  <li><strong><a href="http://singularityhub.com/2016/04/07/we-should-be-teaching-kids-to-code-biology-not-just-software/">Ciudadanos <em>biohackers</em></a></strong> - enseñando a los jóvenes lenguajes de programación para organismos vivos.</li>\r\n</ul>\r\n \r\n<h3>Nanotecnología - manipular materia a nivel molecular</h3>\r\n<a href="http://cerebrodigital.org/wp-content/uploads/2016/04/giphy-3-1.gif"><img class="size-full wp-image-7130 aligncenter" src="http://cerebrodigital.org/wp-content/uploads/2016/04/giphy-3-1.gif" alt="giphy (3)" width="480" height="360"></a>\r\n\r\n"Hay mucho espacio en el fondo", decía Richard Feynman en 1959. Y en 1981, con la invención del <a href="https://commons.wikimedia.org/wiki/File:Quantum_tunnel_effect_and_its_application_to_the_scanning_tunneling_microscope.ogv">microscopio de efecto túnel</a>, nació la industria de la nanotecnología; la cual, dice Kurzweil, nos permitirá reconfigurar "molécula a molécula, nuestros cuerpos, nuestros cerebros, y el mundo en el que vivimos." Además de <a href="http://www.understandingnano.com/nanotech-applications.html">las aplicaciones prácticas que ya utilizamos hoy en día</a>, actualmente se investigan cosas como:\r\n<ul>\r\n   <li><a href="http://phys.org/news/2016-02-stretchable-nano-devices-smart-contact-lenses.html"><strong>Lentes de contacto inteligentes</strong></a> - para filtrar radiación nociva e incluso desplegar información como una pantalla.</li>\r\n  <li><a href="http://www.qmed.com/mpmn/medtechpulse/3-d-printing-revolution-expands-batteries"><strong>Impresión 3D de mini baterías</strong></a> - con <em>tintas</em> electroquímicamente activas, igual de eficientes que las baterías comerciales.</li>\r\n  <li><a href="http://www.news.cornell.edu/stories/2013/10/gold-plated-nano-bits-find-destroy-cancer-cells"><strong>Nanopartículas que  matan el cáncer</strong></a> - partículas de oro localizadas que destruyen las células cancerígenas con calor, sin dañar otras regiones, reduciendo la necesidad de utilizar químicos tóxicos y radiación para tratar tumores.</li>\r\n   <li><a href="http://phys.org/news/2014-10-breakthrough-molecular-electronics-paves-dna-based.html"><strong>Computación via ADN</strong></a> - cadenas moleculares como circuitos electrónicos –un hito en la miniaturización de transistores–.</li>\r\n</ul>\r\n \r\n<h3>Robótica - inteligencia artificial superior a la humana</h3>\r\n<a href="http://cerebrodigital.org/wp-content/uploads/2016/04/ImageForArticle_1921.jpg"><img class="size-full wp-image-7132 aligncenter" src="http://cerebrodigital.org/wp-content/uploads/2016/04/ImageForArticle_1921.jpg" alt="ImageForArticle_192(1)" width="640" height="368"></a>\r\n\r\nKurzweil define la robótica como la encarnación de la inteligencia artificial, aunque lo verdaderamente importante es la IA en sí. En este campo, el objetivo siempre ha sido imitar la inteligencia humana. Pero, como argumenta Kurzweil, una IA que funcione a nivel humano ya superaría nuestras capacidades por las siguientes razones:\r\n<ul>\r\n  <li>"Las máquinas pueden reunir recursos de maneras que los humanos no pueden."</li>\r\n  <li>"Las máquinas poseen memorias precisas."</li>\r\n   <li>"Pueden trabajar a niveles óptimos de forma consistente, y combinar habilidades óptimas."</li>\r\n</ul>\r\nYa hoy existen IAs de uso cotidiano, como Siri o Cortana, Google Now, etc. Y tendemos a pensar en la inteligencia artificial en esos términos. Pero también existe IA en cosas como:\r\n<ul>\r\n   <li>Software de reconocimiento de voz e imágenes.</li>\r\n  <li>Software de reconocimiento de patrones para armamento autónomo.</li>\r\n  <li>Programas para la detección de fraude en operaciones financieras.</li>\r\n  <li>Los métodos estadísticos que utiliza Google para calificar sitios Web.</li>\r\n</ul>\r\n \r\n<h3>La importancia de las tecnologías GNR</h3>\r\nEn el futuro se espera que las inteligencias artificiales sean capaces de aprender por sí solas, sin necesidad de ser programadas o instruidas por humanos. A esto se le llama "aprendizaje profundo", y actualmente se está realizando investigación en este campo.\r\n\r\nComo es el caso de las tecnologías más poderosas, estas pueden producir grandes beneficios para la humanidad, así como representar grandes amenazas. Estas tres tecnologías "proveerán maneras de superar viejos problemas como la enfermedad o la pobreza, pero también serán fuentes de poder para ideologías destructivas", escribe Kurzweil. "No tenemos más opción que reforzar nuestras defensas mientras aplicamos estas tecnologías aceleradas para mejorar nuestros valores humanos, a pesar de la falta de consenso respecto a qué valores son esos." Es necesario incitar el debate y discutir estos temas lo antes posible para que los efectos sean positivos y prontos.\r\n\r\n \r\n\r\n \r\n\r\n<a href="http://singularityhub.com/2016/04/19/ray-kurzweil-predicts-three-technologies-will-define-our-future/?utm_content=buffer74d7b&utm_medium=social&utm_source=facebook.com&utm_campaign=buffer">Artículo original (en inglés).</a>\r\n\r\n <p></p><p></p>', 'http://cerebrodigital.org/wp-content/uploads/2016/04/giphy-2-2.gif', 10, 'tres-tecnologias-definiran-futuro', 'publicada', '2016-04-28 20:32:35', '2016-05-01 12:05:04', 0, 'image', '', ''),
(23, 1, 'IBM está dando acceso gratuito a su procesador online de computación cuántica', '<p><span style="font-weight: 400;">¿Te interesa incursionar en la computación cuántica? IBM acaba de poner uno de sus </span><a href="https://www-03.ibm.com/press/us/en/pressrelease/49661.wss" target="_blank"><span style="font-weight: 400;">procesadores de computación cuántica disponibles en línea </span></a><span style="font-weight: 400;">para quien quiera usarlo.</span>\r\n\r\n<span style="font-weight: 400;">No es tan sencillo como iniciar sesión en la computadora de IBM desde tu navegador, tendrás que solicitar en la página web de </span><a href="http://www.research.ibm.com/quantum/" target="_blank"><span style="font-weight: 400;">IBM Research</span></a><span style="font-weight: 400;">. Según IBM, la tecnología que quieres usar y cuánto sabes acerca de la computación cuántica se utilizarán para determinar el tipo de acceso que te den a través del portal en línea.</span></p><p><span style="font-weight: 400;"><br></span>\r\n\r\nEl procesador cuántico en cuestión se almacena en un centro de investigación de IBM en Nueva York. Un sofisticado sistema de refrigeración mantiene el chip en el cero absoluto, para que el procesamiento cuántico pueda tener lugar.\r\n\r\nLa computación cuántica utiliza qubits (partículas que pueden estar en varios estados a la vez) en lugar de los transistores estándar que se utilizan en los ordenadores de hoy en día, que se pueden ajustar a 1 ó 0. </p><p>Esta flexibilidad conduce a un procesamiento más potente, ya que los qubits pueden ser 0, 1, o ambos, en cualquier momento dado.\r\n\r\nPoner esa potencia de procesamiento para trabajar en previsiones meteorológicas o estudios de cáncer, y podría ser revolucionaria.\r\n\r\nEl sistema IBM utiliza cinco qubits, y está diseñado para aumentar la conciencia de la computación cuántica y su potencial.\r\n\r\n<iframe src="https://www.youtube.com/embed/jf7D8snlsnQ" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>', '', 0, 'ibm-esta-dando-acceso-gratuito-procesador-online-computacion-cuantica', 'publicada', '2016-05-10 01:59:29', '2016-05-10 01:59:29', 0, '', '', ''),
