(84, 1, 'Mapa de terremotos desde 1898', '<p><span style="font-weight: 400;">La tragedia ocurrida en Ecuador el pasado 16 de abril es prueba de que la Tierra es un lugar inestable e impredecible. Pero aunque un desastre natural puede ocurrir en virtualmente cualquier lugar del mundo, existen zonas en las que es mucho más probable que ocurra, por su naturaleza geográfica.</span>\r\n\r\nEn este mapa, compilado por <a href="http://uxblog.idvsolutions.com/2012/06/earthquakes-since-1898.html">John Nelson</a> para <a href="http://idvsolutions.com/">IDV Solutions</a>, se muestra un total de 203 186 terremotos de magnitud 4.0 en adelante, registrados entre 1898 y 2003. Los puntos más brillantes en el mapa corresponden a los terremotos de mayor magnitud, hasta 8.0.\r\n</p><p style="text-align: left;">\r\nComo se puede apreciar en el mapa, los terremotos son más predominantes en la costa oeste del continente amerciano y en el oriente de Asia, ubicadas en torno a las placas del Pacífico, de Nazca y la placa filipina.\r\n\r\nA pesar de que no se muestran todos los terremotos ocurridos, pues no fue sino hasta los años 60 que se comenzó a registrar actividad sísmica de manera precisa,&nbsp;esta compilación permite apreciar perfectamente los patrones en que suceden estos acontecimientos geográficos. "Trazar terremotos no es nada nuevo", dice Nelson. "Se trata sólo de presentarlos de una forma interesante."\r\n\r\n<span style="font-weight: 400;">Se puede descargar el mapa en mayor resolución <a href="https://www.flickr.com/photos/idvsolutions/7439877658/sizes/o/in/photostream/">aquí</a>, así como <a href="https://www.flickr.com/photos/idvsolutions/7610972800/sizes/c/in/photostream/">esta otra</a> vista desde los polos.</span></p><p style="text-align: center; "><div style="text-align: left;"><br></div>\r\n\r\n<a href="http://cerebrodigital.org/wp-content/uploads/2016/04/7610972800_088db0abcb_c.jpg"><img class="alignnone size-full wp-image-6995" src="http://cerebrodigital.org/wp-content/uploads/2016/04/7610972800_088db0abcb_c.jpg" alt="7610972800_088db0abcb_c" width="450" height="800"></a></p>', 'https://s3.amazonaws.com/cerebrodigital/blog/uploads/mapa-terremotos-desde-1898.jpg', 0, 'mapa-terremotos-desde-1898', 'publicada', '2016-05-13 07:49:50', '2016-05-13 07:49:51', 0, '', '', ''),
(85, 1, 'Esta semana en la Ciencia [10-17 Abril 2016]', '<h3>Un hombre cuadripléjico usa un implante cerebral para utilizar su mano de nuevo</h3>\r\n<iframe src="https://www.youtube.com/embed/7rgdK3A1Jp0" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe>\r\n<h3></h3>\r\n<h3>Alemania comenzó a instalar granjas verticales en sus supermercados</h3>\r\n<iframe src="https://www.youtube.com/embed/TaQO4brt248" width="560" height="315" frameborder="0" allowfullscreen="allowfullscreen"></iframe>\r\n<h3></h3>\r\n<h3>Han descubierto el mecanismo epigenético para activar o desactivar la herencia de memorias.</h3>\r\nNuestras experiencias de vida pueden ser <a href="http://www.kurzweilai.net/onoff-button-for-passing-along-epigenetic-memories-to-our-children-discovered?utm_source=KurzweilAI%20Weekly%20Newsletter">heredadas a nuestros hijos</a> y a los hijos de nuestros hijos, y ahora los científicos han descubierto que esta herencia se puede activar o desactivar.\r\n\r\nLas respuestas epigenéticas que se heredan siguen un proceso activo, cada que se pasan de generación en generación.\r\n\r\nLos científicos fueron capaces de determinar que los genes Modificado transgeneracional epigenético Cinética (MOTEK) están involucrados en activar o desactivar transmisión epigenética.\r\n\r\nEl presente estudio se llevó a cabo en los gusanos, pero la comprensión de los principios detrás del proceso de transmisión de la información epigenética en última instancia, se presta a una teoría más amplia de la herencia, en especial para los seres humanos.\r\n<h3></h3>\r\n<h3>Stephen Hawking, Yuri Milner, y Mark Zuckerberg se asociaron para construir una nave interestelar.</h3>\r\n<a href="https://cerebrodigital.org/starshot-stephen-hawking-equipo-desarrollan-tecnologia-interestelar/">Breakthrough Initiatives</a> es un programa reciente de investigación y desarrollo científico que busca establecer contacto con vida extraterrestre, rastréandola entre las estrellas. En él colaboran tanto Stephen Hawking como personalidades de la talla del billonario Yuri Milner y Mark Zuckerberg.\r\n<h3></h3>\r\n<h3>Científicos descubrieron un cuásar que expulsa chorros de plasma a una temperatura que pensaban era “imposible”</h3>\r\nLas nuevas observaciones muestran las temperaturas que expulsa en chorros de plasma el <a href="http://www.space.com/32467-black-hole-jets-hotter-than-expected.html?cmpid=514648&amp;utm_content=buffer607de&amp;utm_medium=social&amp;utm_source=twitter.com&amp;utm_campaign=buffer">cuásar 3C 273</a> en una galaxia distante llegaron a alcanzar los 9999999999982.2227 grados celsius.\r\n\r\n&nbsp;\r\n<h3>Japón está desarrollando un tren cuyo exterior es invisible ya que refleja el paisaje.</h3>\r\nSeibu Railway Co. ya cuenta con un tren en marcha. Pero han contratado el arquitecto Kazuyo Sejima, premio Pritzker, que rehacer todo el exterior y el interior. Sejima quiere hacer todo el exterior casi transparente, para conmemorar su aniversario de 100 años.\r\n\r\nEl tren en sí no será envuelto en invisibilidad, pero los arquitectos de la obra afirman que va a mezclarse con su entorno inmediato a través de una superficie de espejo reflectante.', 'https://s3.amazonaws.com/cerebrodigital/blog/uploads/esta-semana-la-ciencia-10-17-abril-2016.jpg', 0, 'esta-semana-la-ciencia-10-17-abril-2016', 'publicada', '2016-05-13 08:02:57', '2016-05-13 08:02:58', 0, '', '', ''),
