(93, 1, 'Un hotel espacial en el 2020', '<span style="font-weight: 400;">El lunes 11 de abril en una conferencia </span><span style="font-weight: 400;">Robert Bigelow fundador y presidente de </span><a href="http://bigelowaerospace.com/" target="_blank"><span style="font-weight: 400;">Bigelow aeroespace</span></a><span style="font-weight: 400;"> y Tory Bruno el CEO de United Launch Alliance</span><a href="http://www.ulalaunch.com/careers.aspx" target="_blank"><span style="font-weight: 400;"> (ULA)</span></a><span style="font-weight: 400;"> anunciaron que van asociarse para construir un hotel espacial inflable para el 2020.</span>\r\n<p style="text-align: justify;"><span style="font-weight: 400;">Bigelow aerospace construye estaciones espaciales inflables y ULA lanza cohetes. La semana pasada Bigelow envió a la ISS un módulo de actividad expansible (BEAM) en la misión de SpaceX. BEAM una vez inflado les dará a los astronautas un cuarto 3.6 metros adicionales en el espacio. </span></p>\r\n<p style="text-align: justify;"><span style="font-weight: 400;">Todo lo que le suceda a BEAM servirá de información para desarrollar su próximo hotel espacial B330, que se inflará con solo presionar un botón a un espacio de 330 metros cúbicos y estará en la </span><a href="https://es.wikipedia.org/wiki/%C3%93rbita_baja_terrestre" target="_blank"><span style="font-weight: 400;">órbita baja terrestre</span></a><span style="font-weight: 400;">.</span></p>\r\n<p style="text-align: justify;"><span style="font-weight: 400;">Robert Bigelow anunció que la compañía planea construir dos estaciones B330 para el 2019 y comenta&nbsp;que los hábitats expandibles se pueden unir y funcionar para investigación científica, hábitat en otros planetas, y destinos turísticos. </span></p>', 'https://s3.amazonaws.com/cerebrodigital/blog/uploads/hotel-espacial-2020.jpg', 0, 'hotel-espacial-2020', 'publicada', '2016-05-13 23:02:08', '2016-05-13 23:02:09', 0, 'image', 'bigelow,espacial,hotel,inflable,orbita', ''),
