(123, 1118459354832185, 'Video de tardígrado u osos de agua bajo un microscopios', '<p><span style="color: rgb(20, 24, 35); font-family: helvetica; font-size: 110%; line-height: 1.42857;">Vídeo de un tardígrado (conocido también como "oso de agua"), que despertó después de estar más de 30 años congelado. La resurrección del animal microscópico se logró con el apoyo de los científicos del Instituto Nacional de Investigación Polar de Japón. Los osos de agua pueden llegar a vivir 120 años, pueden sobrevivir a la falta de oxigeno y a la radiación ultravioleta</span><br></p>', 234, 'http://dn934mu97ziz5.cloudfront.net/videos/114ososss.mp4', 'ciencia, tecnologia', 344, 0, 1, '2016-05-28 13:29:13', '2016-06-15 23:24:53', 344, '', 1),
(124, 1119495618061892, 'La garcita verde (Butorides virescens) usa carnada para pescar', '<p><span style="color: rgb(29, 33, 41); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 18.76px;">La garcita verde (Butorides virescens) usa carnada para pescar</span><br></p>', 0, 'http://dn934mu97ziz5.cloudfront.net/videos/110garcita.mp4', 'garcita, curiosa, ciencia', 0, 0, 1, '2016-05-28 13:35:08', '2016-06-03 00:42:52', 0, '', 1),
(125, 1118145671530220, 'Granjeros en Japón plantan arroz de la siguiente manera', '<p><span style="font-size: 110%; font-family: helvetica; color: rgb(20, 24, 35);" data-sheets-value="{" 1":2,"2":"granjeros="" en="" jap\\u00f3n="" plantan="" arroz="" de="" la="" siguiente="" manera"}"="" data-sheets-userformat="{" 2":14915,"3":[null,0],"4":[null,2,16777215],"9":0,"12":0,"14":[null,2,1316899],"15":"helvetica,="" arial,="" sans-serif","16":11}"="">Granjeros en Japón plantan arroz de la siguiente manera</span></p><p><font color="#141823" face="helvetica"><span style="font-size: 14.3px; line-height: 20.4286px;">ssds</span></font></p><p><font color="#141823" face="helvetica"><span style="font-size: 14.3px; line-height: 20.4286px;">dsdsd</span></font></p>', 23727, 'http://dn934mu97ziz5.cloudfront.net/videos/116arroz.mp4', 'arroz, japon, tecnologia', 13333, 0, 14, '2016-05-28 21:50:33', '2016-06-17 06:04:17', 876225, '', 1),
