INSERT INTO `video_comments` (`id`, `fb_id`, `name`, `message`, `type`, `video_id`, `user_id`, `created_at`, `updated_at`) VALUES
(1, 594032600774276, 'Rafael Teran', 'El tardígrado comúnmente llamado "oso de agua"sobrevive a alturas como las del Himalaya, o las profundidades de la zona abisal en el océano. Se conoce como la única especie capaz de sobrevivir en el espacio sin ningún tipo de aditamento. Puede sobrevivir a temperaturas extremas tanto inferiores como superiores. Además puede detener su reloj biológico por períodos extensos (años) y después activarlo de nuevo y continuar con su ciclo de vida de manera normal. Saludos!', 'facebook', 123, NULL, '2016-05-28 13:35:45', '2016-05-28 13:35:45'),
(2, 10153849354536865, 'Gerdan Montenegro', 'El planeta tierra no es de los Humanos, es de los Tardígrados.', 'facebook', 123, NULL, '2016-05-28 13:35:45', '2016-05-28 13:35:45'),
(3, 10154882499607366, 'Celeste Arancibia', 'En mi opinión lo más sorprendente es que cerca de 6000 genes del tardígrado son foráneos. Probablemente hayan sido obtenidos por transferencia horizontal de bacterias, hongos y hasta plantas. Quizás este fenómeno es el que los haga tan resistentes a los ambientes  hostiles http://www.iflscience.com/plants-and-animals/mega-gene-theft-may-explain-why-water-bears-are-so-hardy-0', 'facebook', 123, NULL, '2016-05-28 13:35:45', '2016-05-28 13:35:45'),
(4, 10154049388486013, 'Herrera Julio', 'Tanto tiempo a vivido y no ha evolucionado? En algo mas grande e inteligente? Y otrasi son resistentes, entonces como mueren o se les mata, pues al ''no morir'' deberiamos estar invadidos de ellos, no?', 'facebook', 123, NULL, '2016-05-28 13:35:45', '2016-05-28 13:35:45'),
(5, 1196683873705190, 'Josel Martin Marin', 'A mi parecer el tardigrado hablando cientificamente o ambien conocido como tardigrado se le atrubuye benificios bilogicos asi como en la humanidad sentimos mucho su extincion ya que la pechuga de tardigrado en mole de acuyo es muyy sabrosa es mi aportacion cientifica...', 'facebook', 123, NULL, '2016-05-28 13:35:45', '2016-05-28 13:35:45'),
(6, 1092681890792595, 'Ivan Idrogo', 'Algunas cosas que debes saber:\n1.- Hasta 1929 la Coca-Cola tenía cocaína. \n2.- El cocodrilo es el único animal que no puede sacar su lengua.\n3.- El elefante es el único mamífero que no puede saltar. \n4.- El único alimento que no se pudre es la miel.\n5.- La silla eléctrica fue inventada por Thomas Edison. \n6.- En el mundo se mandan más de 10 mil mensajes de \nWhatsApp por segundo.\n\nSi te gustó, únete a nuestra página No es Mentira', 'facebook', 123, NULL, '2016-05-28 13:35:45', '2016-05-28 13:35:45'),
(7, 10209164420523833, 'David Jose Rade', 'No me extrañaria que cuando los humanos desaparezcan, que no es algo lejano estos seres evolucionen mucho mas y gobiernen la tierra', 'facebook', 123, NULL, '2016-05-28 13:35:45', '2016-05-28 13:35:45'),
(8, 1217114034978922, 'Alexandra García', 'Ya había visto está noticia, se conocía que un tardígrado podía revivir  luego de experimentar con él,  hicieron el descogelamiento de uno que llevaba 7 años en este estado, está es un gran descubrimiento, el tardígrado solo puede verse desde un microscopio, es muy resistente.\n Pueden entrar en un estado de animación suspendida necesitan hacerlo.\nLa forma más común en la que ellos hacen esto es secándose y arrugándose, ya que reducen su contenido de agua a menos de un 1% de lo normal. Detienen su metabolismo. Esto mataría a la mayoría de los animales, pero a los tardígrados solo los hace más fuertes. También pueden pasar así el rato durante cien años antes de regenerarse con toda tranquilidad.', 'facebook', 123, NULL, '2016-05-28 13:35:46', '2016-05-28 13:35:46'),
(9, 10154285894637755, 'Oscar Rosas', 'Sólo con kriptonita se puede lastimar a ese ser llegado de otra galaxia.', 'facebook', 123, NULL, '2016-05-28 13:35:46', '2016-05-28 13:35:46'),
(10, 1076399415751762, 'Enrique Pacheco', 'Dicen que necesitas clavarles una estaca en el corazón, solo así mueren.', 'facebook', 123, NULL, '2016-05-28 13:35:46', '2016-05-28 13:35:46'),
(11, 10206651238741999, 'Allen Mora', 'a lo que recuerdo, encontraron en musgo uno que estuvo "muerto" por mas de 120 años, y solo ocuparon una gota de agua para reanimarlo', 'facebook', 123, NULL, '2016-05-28 13:35:46', '2016-05-28 13:35:46'),
(12, 10154200279011703, 'Kyky Van Dort', 'Son osos radioactivos por diosss que queden ellos como dueños d la tierra y no las cucarachas', 'facebook', 123, NULL, '2016-05-28 13:35:46', '2016-05-28 13:35:46'),
