(1314, 1114924731899861, 'Florencia Cortes', 'Alejandra Saucedo ADVERTENCIA! Continua la lectura o morirás,\nincluso si usted sólo miraba la advertencia de la\npalabra! Una vez que hubo una pequeña niña\n\nllamada Clarissa, tenía diez años de edad y ella\nvivió en un hospital psiquiátrico, porque ella\nmató a su mamá y su papá. Obtuvo tan mal iba\na matar a todo el personal en el hospital por lo\nque el gobierno más decidió que era mejor idea\npara deshacerse de ella por lo que establecieron\nuna habitación especial para matarla, tan\nhumano como posible, pero salió mal la\nmáquina estaban utilizando salió mal. Y se sentó\nallí en agonía durante horas hasta que ella\nmurió. Ahora cada semana en el día de su\nmuerte ella regresa a la persona que lee esta\ncarta, en la noche del lunes a las 12:00 a.m. Ella\nse arrastra a su habitación y te mata lentamente,\ncorte y viendo sangrar hasta la muerte. Ahora\nenviar esto a diez otras fotos en este sitio, y ella\npersiguen a alguien que no. Esto no es falso. al\nparecer, si copia y pega esto a diez comentarios\nen los próximos diez minutos usted tendrá el\nmejor día de tu vida mañana. Usted será obtener\nbesó o frecuentes, si rompes esta cadena se verá\na una niña muerta en su habitación esta noche.\nEn 53 minutos alguien dirá te amo o lo siento!!!', 'facebook', 126, NULL, '2016-05-29 11:06:07', '2016-05-29 11:06:07'),
