(1704, 1042845125802615, 'Alejandro Fourmantin', 'La Biblia una niña de 15 años\nRecibió una\nMensaje\nEn el\nFacebook,\nExcluyó ni leyó la\nMensaje toda\nSólo\nPorque\nHablaba de Jesús, y\nJesús le dijo:\nHija\nEnvíe esta msm\nPorque\nMañana\nPuede ser tarde. La\nSrta.\nCon ironía riu y\nHabló\n" más\nQué mentira " en el día\nSiguiente ella\nAmaneció\nMuerta, pero antes\nDe\nMorir\nDejó una nota\nDiciendo.\nNo\nIgnore Dios, puede\nNo\nSer Él que\nEscribió pero\nÉl fue el que mandó\nPara\nPrueba tú.\nSi usted ama Dios\nMande\nEsa\nMsm para\n20 comentarios. Ahora\nUsted\nEsta\nEn el recuento! En 9\nMinutos,\nAlgo te va a hacer\nFeliz.\nTodo en la vida son\nDetalles...\nEspero que\nUsted\nLea con mucha\nAtención, porque es de\nCorazón!\nEstoy pasando por\nDecir que\nAlgo muy bueno\nPasó\nConmigo Hoy,\nRecibí el mensaje\nAbajo, y\nCuando estaba\nEmpezando a\nReenviarlo\nRecibí una gran\nNoticias\nEspero que de\nCorrecto\nUsted\nTambién!\nSalmo 100:4 Dice:\nDios\nHa visto sus\nPeleas.\nDios dice que ellas\nEstán\nLlegando a su fin.\nUna\nBendición\nEsta viniendo\nEn\nSu Dirección, si\nUsted cree. Qum ta sin sueño da un me gusta', 'facebook', 126, NULL, '2016-05-29 11:06:07', '2016-05-29 11:06:07'),
