(2461, 10209229632159118, 'Christian Jara Rojel', 'Según el Dr Mark Brandon, oceanógrafo polar de la Open University, éste fenómeno es debido a que en invierno, la temperatura del aire sobre la capa de hielo de la superficie puede ser inferior a -20°C, mientras que la del agua del mar es de tan solo -1.9°C. El calor fluye subiendo desde el mar más caliente hasta el aire muy frío, formando nuevo hielo desde el fondo. La sal de este hielo recién formado se concentra en estos canales de agua salada. Esta salmuera, al estar tan fría y salada, es más densa que el agua debajo de la supeficie.\n\nEl resultado es que la salmuera se hunde en una columna descendente. A medida que entra en contacto con el agua relativamente fresca del fondo marino, la congela paulatinamente. Así va creciendo este frágil tubo de hielo, que mata a las estrellas marinas y a todo lo que se ponga en su camino, como se puede apreciar en el vídeo.', 'facebook', 130, NULL, '2016-05-31 09:47:57', '2016-05-31 09:47:57'),
