(3467, 10209229632159118, 'Christian Jara Rojel', 'Según el Dr Mark Brandon, oceanógrafo polar de la Open University, éste fenómeno es debido a que en invierno, la temperatura del aire sobre la capa de hielo de la superficie puede ser inferior a -20°C, mientras que la del agua del mar es de tan solo -1.9°C. El calor fluye subiendo desde el mar más caliente hasta el aire muy frío, formando nuevo hielo desde el fondo. La sal de este hielo recién formado se concentra en estos canales de agua salada. Esta salmuera, al estar tan fría y salada, es más densa que el agua debajo de la supeficie.\n\nEl resultado es que la salmuera se hunde en una columna descendente. A medida que entra en contacto con el agua relativamente fresca del fondo marino, la congela paulatinamente. Así va creciendo este frágil tubo de hielo, que mata a las estrellas marinas y a todo lo que se ponga en su camino, como se puede apreciar en el vídeo.', 'facebook', 130, NULL, '2016-02-03 06:00:29', '2016-02-03 06:00:29'),
(3468, 285459778460194, 'Isabel Zavala', 'Sinceramente dá un poco de susto al ver la imagen sin ningún tipo de explicación, sin embargo es un interesante fenómeno que hasta ahora desconocia...Gracias por el video y por la explicación que algunos ya han dado', 'facebook', 130, NULL, '2016-02-03 08:26:42', '2016-02-03 08:26:42'),
(3469, 1326818504000629, 'Tati Sampere Gavieiro', 'Excelente EXPLICACIÓN de este fenómeno:\nhttp://cienciadesofa.com/2013/11/carambanos-de-la-muerte.html', 'facebook', 130, NULL, '2016-02-03 06:04:26', '2016-02-03 06:04:26'),
(3470, 10208479836608584, 'Fabian Espinoza', 'El video fue tomado en stop motion o esa es la velocidad a la que ocurre el fenomeno, pregunto por que las estrellas de mar se mueven mucho mas rapido de lo que creia', 'facebook', 130, NULL, '2016-02-03 07:06:14', '2016-02-03 07:06:14'),
(3471, 1113418825377556, 'Luis Perez', 'Cada día aprendo algo nuevo, y me quedo maravillado, de hechos como este. Las maravillas que tiene la naturaleza son increíbles y lo que infinitamente nos falta por aprender.', 'facebook', 130, NULL, '2016-02-03 08:56:56', '2016-02-03 08:56:56'),
(3472, 995593760539279, 'Uriel Talavera', 'Cuando el agua llega a temperaturas extremadamente frías el agua comienza a calentarse por lo que abajo esta calido la superficie crea con el frio y calor un remolino de hielo. o algo asi entendi XD', 'facebook', 130, NULL, '2016-02-03 06:19:49', '2016-02-03 06:19:49'),
