(4473, 594032600774276, 'Rafael Teran', 'Hablando de medusas hay una excepcional :La medusa Turritopsis Nutrícula tiene un periodo de madurez bastante corto (unas cuantas semanas), además de que su tamaño ronda los 5mm de diámetro. Por medio de la transdiferenciación esta medusa transforma sus células de la capa externa , invirtiendo lo exterior con lo interior del cuerpo, los tentáculos los re absorbe para dar inicio a la fase pólipo de nuevo. Hay especies que pueden regenerar partes del organismo o algunos miembros, esta medusa es el único con la capacidad de regenerar todo su cuerpo. Buena noche', 'facebook', 131, NULL, '2015-11-21 06:51:59', '2015-11-21 06:51:59'),
