(4598, 1793911087494435, 'German Jackgger', 'Este experimento funciona a base de un fenómeno llamado inducción eléctrica y el metal que esta calentando lo hace por medio de fuerzas electromagnéticas y el metal calentado debe ser aluminio o fierro. Busquen a Michel Faraday y profundicen, este experimento es un horno de inducción, muy usado en la industria para fundir aluminio', 'facebook', 132, NULL, '2015-11-20 03:17:25', '2015-11-20 03:17:25'),
(4599, 1069743913072317, 'Luis Alberto Perez Daga', 'Por más que avance la ciencia nunca podrán mejorar la efectividad de un un buen lápiz de madera bien puntiagudo! ', 'facebook', 132, NULL, '2015-11-20 03:31:44', '2015-11-20 03:31:44'),
(4600, 10153909275122795, 'Shara Siplenko', 'Aunque no es incorrecto "derretir" hablando de metales es mas apropiado usar el termino "fundir", es solo una sugerencia.', 'facebook', 132, NULL, '2015-11-20 03:49:01', '2015-11-20 03:49:01'),
(4601, 1014572291912651, 'Erick Shakur', 'Disculpen la ignorancia pero alguien podría contestar estas dudas?\n-El cobre es alambre como tal osea grosor solido o esta hueco o es una resistencia?\n-Qué tipo de metal es? Funciona con todos los metales?\nGracias.', 'facebook', 132, NULL, '2015-11-20 03:13:17', '2015-11-20 03:13:17'),
(4602, 1360022804015097, 'Jaime Elihezer Valadez', 'Por si alguien se pregunta por qué derrepente se cayo, esto se debió a que ocurrió una transformación de fases dentro del metal, pasando de estructura ferrita a austenita, esta transformación es causada por el incremento de temperatura y ocurre al rededor de los 900°C y la fase austenita no es magnética como la ferrita', 'facebook', 132, NULL, '2015-11-20 07:13:20', '2015-11-20 07:13:20'),
(4603, 1763749440535151, 'Ali Ali Mohamed', 'El metal que se derrite flota por inducción electromagnética, ademas de este fenómeno el metal funde por efecto joule.', 'facebook', 132, NULL, '2015-11-20 03:18:49', '2015-11-20 03:18:49'),
(4604, 10154252254654443, 'Luis Lagunes', 'Por encima de su fundición, Me parece más fascinante que el metal levita.', 'facebook', 132, NULL, '2015-11-20 04:57:11', '2015-11-20 04:57:11'),
(4605, 1079425702103183, 'Luis Urbano Morales', 'Pero si el hierro necesita 1200° de temperatura para fundisrse y el cobre 800° no entiendo como no se funde también el cobre!', 'facebook', 132, NULL, '2015-11-20 08:07:12', '2015-11-20 08:07:12'),
(4606, 10205498342131793, 'Dave Vargas', 'Esto ocurre debido a que seguramente sea una corriente alterna lo que recorre la bobina. Esto provoca que las moleculas dentro del metal vayan cambiando de polaridad norte-sur constantemente, por lo que "friccionan" entre si y por el consiguiente, que aparezca la energia en forma de calor.', 'facebook', 132, NULL, '2015-11-21 01:15:47', '2015-11-21 01:15:47'),
(4607, 10154190240606873, 'Nando Rodríguez', 'Explicate eso de q el cobre tiene una "gran energia electrica", pq nose si te refieres a su conductancia o pq la corriente aplicada, en ambos casos,puede ser reemplazado por cualqier otro conductor...', 'facebook', 132, NULL, '2015-11-20 06:45:38', '2015-11-20 06:45:38'),
(4608, 1021799471231168, 'Oscar Montero Godínez', 'un conductor que atraviesa un campo magnético genera pérdidas en forma de calor,  debido a las corrientes inducidas en él, estas corrientes circulantes no deseadas se conocen como corrientes parásitas o de Foucault. El fenómeno se disminuye si el material es muy delgado. Por eso los entre hierros en los transformadores. Y así calientan las cocinas de inducción Jorge Pm', 'facebook', 132, NULL, '2015-11-20 10:55:59', '2015-11-20 10:55:59'),
(4609, 1121196924589539, 'Erick Gtz Pérez', 'Horno de Inducción sin núcleo No sólo en fundición de Aluminio, más usado en Acero y Hierro, el cual va cubierto de una fina capa de refractario en la bobina esta  va refrigerada con agua  ( los tres elementos juntos Agua, metal y tierra) HIN, una capa de refractario en bobina concreto y refractario seco para contener el Acero, hierro, bronce, Cobre, latón etc etc...líquido.  metalurgia.....', 'facebook', 132, NULL, '2015-11-20 08:45:24', '2015-11-20 08:45:24'),
