(4624, 515270862002028, 'Alexis Cesare Espinosa', 'El rango de frecuencias de operación va desde la frecuencia de red (50 ó 60 Hz) hasta los 10 kHz, en función del metal que se quiere fundir, la capacidad del horno y la velocidad de fundición deseada - normalmente un horno de frecuencia elevada (más de 3000 Hz) es más rápido, siendo utilizados generalmente en la fundición de aceros, dado que la elevada frecuencia disminuye la turbulencia y evita la oxidación. Frecuencias menores generan más turbulencias en el metal, reduciendo la potencia que puede aplicarse al metal fundido.', 'facebook', 132, NULL, '2015-11-20 11:58:41', '2015-11-20 11:58:41'),
