(8332, 1793911087494435, 'German Jackgger', 'Este experimento funciona a base de un fenómeno llamado inducción eléctrica y el metal que esta calentando lo hace por medio de fuerzas electromagnéticas y el metal calentado debe ser aluminio o fierro. Busquen a Michel Faraday y profundicen, este experimento es un horno de inducción, muy usado en la industria para fundir aluminio', 'facebook', 132, NULL, '2015-11-20 03:17:25', '2015-11-20 03:17:25'),
(8333, 1069743913072317, 'Luis Alberto Perez Daga', 'Por más que avance la ciencia nunca podrán mejorar la efectividad de un un buen lápiz de madera bien puntiagudo! ', 'facebook', 132, NULL, '2015-11-20 03:31:44', '2015-11-20 03:31:44'),
(8334, 10153909275122795, 'Shara Siplenko', 'Aunque no es incorrecto "derretir" hablando de metales es mas apropiado usar el termino "fundir", es solo una sugerencia.', 'facebook', 132, NULL, '2015-11-20 03:49:01', '2015-11-20 03:49:01'),
(8335, 1014572291912651, 'Erick Shakur', 'Disculpen la ignorancia pero alguien podría contestar estas dudas?\n-El cobre es alambre como tal osea grosor solido o esta hueco o es una resistencia?\n-Qué tipo de metal es? Funciona con todos los metales?\nGracias.', 'facebook', 132, NULL, '2015-11-20 03:13:17', '2015-11-20 03:13:17'),
(8336, 1360022804015097, 'Jaime Elihezer Valadez', 'Por si alguien se pregunta por qué derrepente se cayo, esto se debió a que ocurrió una transformación de fases dentro del metal, pasando de estructura ferrita a austenita, esta transformación es causada por el incremento de temperatura y ocurre al rededor de los 900°C y la fase austenita no es magnética como la ferrita', 'facebook', 132, NULL, '2015-11-20 07:13:20', '2015-11-20 07:13:20'),
(8337, 1763749440535151, 'Ali Ali Mohamed', 'El metal que se derrite flota por inducción electromagnética, ademas de este fenómeno el metal funde por efecto joule.', 'facebook', 132, NULL, '2015-11-20 03:18:49', '2015-11-20 03:18:49'),
(8338, 10154252254654443, 'Luis Lagunes', 'Por encima de su fundición, Me parece más fascinante que el metal levita.', 'facebook', 132, NULL, '2015-11-20 04:57:11', '2015-11-20 04:57:11'),
(8339, 1079425702103183, 'Luis Urbano Morales', 'Pero si el hierro necesita 1200° de temperatura para fundisrse y el cobre 800° no entiendo como no se funde también el cobre!', 'facebook', 132, NULL, '2015-11-20 08:07:12', '2015-11-20 08:07:12'),
(8340, 10205498342131793, 'Dave Vargas', 'Esto ocurre debido a que seguramente sea una corriente alterna lo que recorre la bobina. Esto provoca que las moleculas dentro del metal vayan cambiando de polaridad norte-sur constantemente, por lo que "friccionan" entre si y por el consiguiente, que aparezca la energia en forma de calor.', 'facebook', 132, NULL, '2015-11-21 01:15:47', '2015-11-21 01:15:47'),
(8341, 10154190240606873, 'Nando Rodríguez', 'Explicate eso de q el cobre tiene una "gran energia electrica", pq nose si te refieres a su conductancia o pq la corriente aplicada, en ambos casos,puede ser reemplazado por cualqier otro conductor...', 'facebook', 132, NULL, '2015-11-20 06:45:38', '2015-11-20 06:45:38'),
(8342, 1021799471231168, 'Oscar Montero Godínez', 'un conductor que atraviesa un campo magnético genera pérdidas en forma de calor,  debido a las corrientes inducidas en él, estas corrientes circulantes no deseadas se conocen como corrientes parásitas o de Foucault. El fenómeno se disminuye si el material es muy delgado. Por eso los entre hierros en los transformadores. Y así calientan las cocinas de inducción Jorge Pm', 'facebook', 132, NULL, '2015-11-20 10:55:59', '2015-11-20 10:55:59'),
(8343, 1121196924589539, 'Erick Gtz Pérez', 'Horno de Inducción sin núcleo No sólo en fundición de Aluminio, más usado en Acero y Hierro, el cual va cubierto de una fina capa de refractario en la bobina esta  va refrigerada con agua  ( los tres elementos juntos Agua, metal y tierra) HIN, una capa de refractario en bobina concreto y refractario seco para contener el Acero, hierro, bronce, Cobre, latón etc etc...líquido.  metalurgia.....', 'facebook', 132, NULL, '2015-11-20 08:45:24', '2015-11-20 08:45:24'),
(8344, 1031327576953245, 'César Augusto Vila Gonzalez', 'Sino preguntenle a Tesla. Pongan algo de los motores magnéticos que según funcionan 3 años sin ninguna fuente externa de energía, con electromagnetismo que ya traen cargado', 'facebook', 132, NULL, '2015-11-20 03:14:26', '2015-11-20 03:14:26'),
(8345, 1157056160984362, 'Moises Andrade', 'No soy ingeniero, pero este método ahora se usa en las cocinas, pues para la industria ya existen métodos más eficientes, en las cocinas existen parrillas de inducción, que básicamente o burdamente hablando usan el magnetismo para hacer que electrones, protones y neutrones se muevan muy rápidamente y provoquen fricción entre ellos, y a su vez calor, ese el primer principio básico, y efectivamente no te quemas, al menos no si no traes anillos o algún metal en la mano.', 'facebook', 132, NULL, '2015-11-22 08:56:13', '2015-11-22 08:56:13'),
(8346, 1105034756185790, 'Marquez Jean Carlos', 'este fenomeno se llama "fundicion cuantica firuplasmica" que consiste en la exposicion de calorr carbonizado previa sumercion en acido ascorbico y bombardeado de protones boreales,el cual miyutiza el estado material y polfritico del elemento . la unica forrma de hacer esto es teniendo un condensador de flujo rectificado en grado bolminido.', 'facebook', 132, NULL, '2015-11-20 04:07:13', '2015-11-20 04:07:13'),
(8347, 10153530283541631, 'Lucas Giovanini', 'Las ondas electromagnéticas generadas producen interferencia en las ondas de radio de acuerdo a la potencia utilizada. Pregunta: ¿pueden esas ondas dañar la salud de una persona ubicada a 1 metro de distancia?', 'facebook', 132, NULL, '2015-12-07 11:53:16', '2015-12-07 11:53:16'),
(8348, 1019533841463979, 'Raphael Campos Pessoa', 'La fuerza electromagnética que produce el cobre lo protege del calor que produce el material inducido y es semejante a un ciclotron donde se puede crear elementos a partir de energía materia y antimateria la gran cantidad de electromagnetismo procura el aislamiento de calor radiación y materia \nBonito juguete el apartado', 'facebook', 132, NULL, '2015-11-20 08:23:02', '2015-11-20 08:23:02'),
(8349, 1022782147800179, 'Daniel Retuerto', 'Williams la levitacion se debe a las fuerzas electrostaticas ??? y el derritiento por la transfomacion de la energia verdad ??? pero siesq no me equivoco tambien entra a tallar el magnetismo pero no sabria en q punto,me responde porfa profe ??? y tambien porq interviene el lapiz,tengo una nocion pero,yo llego a nada claro.', 'facebook', 132, NULL, '2015-11-20 06:03:49', '2015-11-20 06:03:49'),
(8350, 637398793095136, 'Jacob Spohn', '®¥€°√℅12%0.9∆=√.la resistencia en vacío hidrógenado,con cálculo ambiguo en décima potencia,tienes que usar un lugar frío y aparte tendría que estar en cámara baja en decibelios ÷6', 'facebook', 132, NULL, '2015-11-21 06:27:46', '2015-11-21 06:27:46'),
(8351, 866087256853973, 'Cristofer Wladimir Patiño Villamizar', 'Sé llama calentamiento por inducción electromagnetica es utilizado en los hornos dé fundición de aceros pero es muy complejo él sistema electrónico pero un buen tema dé investigación o proyecto', 'facebook', 132, NULL, '2015-11-21 09:10:54', '2015-11-21 09:10:54'),
(8352, 636904536485138, 'Aner Bra''am', 'Es calentamiento por inducción. Se a los electrones "perezosos" que no se alinean de acuerdo al campo magnético variable generado por la C.A. en la bobina (histéresis magnética).', 'facebook', 132, NULL, '2016-01-29 09:35:01', '2016-01-29 09:35:01'),
(8353, 1376106782423614, 'Ricardo Rabre', 'Ermillenin, Mille, vea el proyecto que se estaba tratando de desarrollar en el CELEQ en el 2012, se acuerda? ojalá y lo hayan continuado. Se ve bien chuzo cuando pasa del papel al laboratorio.', 'facebook', 132, NULL, '2015-11-20 05:28:06', '2015-11-20 05:28:06'),
