INSERT INTO `video_comments` (`id`, `fb_id`, `name`, `message`, `type`, `video_id`, `user_id`, `created_at`, `updated_at`) VALUES
(8356, 10153650114573443, 'Harris Mar', 'En realidad por la espira de cobre circula gran cantidad de intensidad electrica a muy alta frecuencia lo que hace que la induccion electrica caliente a alta temperatura materiales metalicos.', 'facebook', 132, NULL, '2015-11-20 03:21:14', '2015-11-20 03:21:14'),
(8357, 1023102974412323, 'L Alejandro Olivo', 'Me pueden decir que es lo que corre por dentro de la tubería de cobre? O que es lo que genera realmente el campo magnético?', 'facebook', 132, NULL, '2015-11-20 05:29:38', '2015-11-20 05:29:38'),
(8358, 515270862002028, 'Alexis Cesare Espinosa', 'El rango de frecuencias de operación va desde la frecuencia de red (50 ó 60 Hz) hasta los 10 kHz, en función del metal que se quiere fundir, la capacidad del horno y la velocidad de fundición deseada - normalmente un horno de frecuencia elevada (más de 3000 Hz) es más rápido, siendo utilizados generalmente en la fundición de aceros, dado que la elevada frecuencia disminuye la turbulencia y evita la oxidación. Frecuencias menores generan más turbulencias en el metal, reduciendo la potencia que puede aplicarse al metal fundido.', 'facebook', 132, NULL, '2015-11-20 11:58:41', '2015-11-20 11:58:41'),
(8359, 10208413706292197, 'Matute Becerra', 'La temperatura del metal aumenta debido a el efectto Joul? No termino de comprender por que el aumento de la temperatura del trozo de metal,', 'facebook', 132, NULL, '2015-11-20 04:09:21', '2015-11-20 04:09:21'),
