(8365, 10209859051341230, 'Americo Antonio Bione', 'una pregunta .....de que esta hecho el metal introducido en el circuito', 'facebook', 132, NULL, '2015-11-20 23:59:59', '2015-11-20 23:59:59'),
(8366, 893564684087933, 'Clayton H. Almeida', 'Igor é uma consequência do efeito Joule. A corrente elétrica que circula na bobina de cobre, confere ao metal uma corrente indutiva que acaba gerando calor pelo efeito Joule e consequentemente entrando em estado de fusão. Este princípio é utilizado em alguns fornos para fusão de metais de baixa fusão como o Alumínio.', 'facebook', 132, NULL, '2015-11-20 04:43:05', '2015-11-20 04:43:05'),
