(8369, 1142508915769726, 'Ricardo Cante Medrano', 'Hola, la levitación del aluminio fue generado por los campos Electromagnéticos, que son Generados a través de un horno de inducción por electromagnetismo , la corriente y los campos que convergen en el mismo inductor o Bobina de forma helicoidal, permiten la levitación del aluminio. Este concepto lo utilizo en el lugar donde laboro, donde se diseñan los "Equipos de inducion". Somos una Empresa orgullosamente  MEXICANA "LUZAR" es nuestra marca de los equipos. les aporte el link de la pagina de You Tube https://www.youtube.com/channel/UCdVLJu1-LNcyc57y1SRsK7Q', 'facebook', 132, NULL, '2015-11-21 11:55:07', '2015-11-21 11:55:07'),
