(9540, 1182142591836203, 'Julio Cesar Chairez', 'Eso es posible gracias a que es un huevo cocido sin cascara, ya que si estuviera crudo y con cascara seria imposible hacer eso, y el fenómeno que se observa es llamado presion de los gases', 'facebook', 133, NULL, '2015-11-10 03:38:13', '2015-11-10 03:38:13'),
(9541, 10154319387250962, 'Olivia Guerrero', 'Es increíble ¿no? ¡Lograste meter un huevo duro en una botella con una abertura angosta y fuiste capaz de eso sin romperlo! ¿Cómo es posible? ¡La presión atmosférica es la respuesta! El experimento simplemente te mostró el comportamiento de la presión atmosférica.\n\nEn nuestro experimento del Huevo en la Botella, después de prender fuego a los cerillos, el oxígeno de la botella se agotó. Cuando colocaste el huevo delante de la abertura, el aire en el interior creó un vacío succionando el huevo hacia la botella.\n\nLos cerillos calientan el aire atrapado dentro de la botella, lo que provoca que se expanda. Después de un corto tiempo, el fuego dentro de la botella se extingue, lo que provoca que el aire en el interior se enfríe causando una presión menor dentro de la botella. El huevo es obligado a ingresar en la botella porque en el interior hay una presión más baja y en el exterior una presión más alta.\n\nAhora intenta sacarlo de ahí... \n\ngirar la botella boca abajo y soplar aire en la botella, la presión atmosférica dentro de la botella aumenta lo que empujará el huevo hacia afuera sin romperlo....', 'facebook', 133, NULL, '2015-11-10 03:47:43', '2015-11-10 03:47:43'),
(9542, 586909078155854, 'Ricardo Martínez', 'mas interesante es como sacar el huevo de ahi sin romperlo ;)', 'facebook', 133, NULL, '2015-11-10 03:42:16', '2015-11-10 03:42:16'),
