(9553, 10209540324564258, 'Fernanda Soledad Ubilla Rodríguez', 'Y para que mierda quiero meter un hueco en una botella? Entrará completo pero tendré que romperlo al sacarlo, o también puedo prender una cerilla por afuera?', 'facebook', 133, NULL, '2015-11-10 13:50:54', '2015-11-10 13:50:54'),
(9554, 10207787914510060, 'Emerson Barrios Mogollon', 'La solución mas lógica es por la LEY DE LOS GASES IDEALES. En este punto tenemos un proceso de cambio de presión y temperatura a volumen constante, descrito por la formula Presión=Temperatura/Volumen  (Los factores nR se consideran constante y despreciables). Cuando ingresamos las cerillas, ellas poseen una temperatura alta (aproximadamente 70°C), cuando se sella la botella con el huevo se comienza a consumir el oxigeno presente, y a medida que aumenta el tiempo, disminuye las moles de oxigeno y por lo tanto la llama comienza a extinguirse (lo que genera una disminución de la temperatura), después de un largo tiempo la llama se "apaga" y la temperatura baja a temperatura ambiente. Como vimos en la ecuación inicial, al disminuir la temperatura, disminuye la presión (esta disminución se evidencia por el fenómeno de la succión) y por lo tanto el huevo como es deformable ingresa finalmente a la botella. Para poder retirar el huevo podríamos hacer lo contrario, aumentar la presión para generar que el huevo salga, y eso lo hacemos pues aumentando la temperatura. Por esto es que es peligroso ingresar a una casa que se este incendiando y que se encuentre con las puertas y ventanas totalmente cerradas, porque al abrirlas, genera una succión grande. Espero les halla servido mi explicación.', 'facebook', 133, NULL, '2015-11-10 05:21:41', '2015-11-10 05:21:41'),
(9555, 1556892351272688, 'Roberth Fabián Sosa Canché', '¿Para que verga quiero un huevo en una botella?', 'facebook', 133, NULL, '2015-11-10 04:33:03', '2015-11-10 04:33:03'),
